import React from 'react';
import { View } from 'react-native';

const Taco = () => {
  return(
    <View style={{
      position: 'absolute',
      backgroundimage: 'url(./_img/tacoSprite.png)',
      width: 'auto',
      height: 'auto',
      
    }} />

  )
}

export default Taco;
